userDefinedLinkHintCss:
div.internalVimiumHintMarker {
  background: linear-gradient(to bottom, #525252 0%, #282828 100%);
  border: none;
  padding: 2px 4px 1px 4px;
  border-radius: 0.25em;
  box-shadow: 0em 0.1em 0.6em 0.1em #282828;
}

div.internalVimiumHintMarker span {
  color: #ebdbb2;
  font-size: inherit;
  font-family: JetBrainsMono Nerd Font;
  text-shadow: #282828;
}

div.internalVimiumHintMarker > .matchingCharacter {
  color: #a89984;
}

#vomnibar {
  border: 1px solid #282828;
  box-shadow: 0px 2px 10px #282828;
  background-color: #3d3d3d;
}
#vomnibar .vomnibarSearchArea {
  background-color: #3d3d3d;
  border: none;
}

#vomnibar input {
  color: #ebdbb2;
  background-color: #3d3d3d;
  border: 1px solid #3d3d3d;
  box-shadow: none;
  font-family: JetBrainsMono Nerd Font;
}

#vomnibarInput::selection {
  color: #282828;
  background-color: #ebdbb2;
}

#vomnibar ul {
  margin: 0;
  background-color: #282828;
}


#vomnibar ul li {
  border-bottom: 1px solid #525252;
}

#vomnibar ul li.vomnibarSelected {
  border-bottom: 1px solid #525252;
}

#vomnibar ul li.vomnibarSelected {
  background-color: #3d3d3d;
}

#vomnibar ul li .vomnibarSource {
  color: #d79921;
}

#vomnibar ul li .vomnibarTitle {
  color: #ebdbb2;
}
#vomnibar ul li .vomnibarTitle .vomnibarMatch,
#vomnibar ul li .vomnibarUrl .vomnibarMatch {
  color: #ebcb8b;
  font-weight: normal;
}

#vomnibar ul li .vomnibarUrl {
  color: #b16286;
}

#vomnibar li .vomnibarTopHalf {
  overflow: visible;
}
